import React from "react";


function Articls(props){
    return(
    <>
        <div className="container">
            <img src={props.img} alt="images" />
            <h1>{props.nmb}</h1>
            <h3>{props.titre}</h3>
            <p>{props.sousTitre}</p>
        </div>
    </>
    );
}

export default Articls;
